travel to distant planets inserting themselves individually into a host body of that
planet's dominant species. They are able to access the host's memories, and occupied
hosts are identifiable by silver rings that form in the hosts' eyes.

A human on the run named Melanie Stryder is captured and infused with a soul called
&quot;Wanderer.&quot; Wanderer is asked by Seeker to access Melanie's memories in order to
discover the location of a pocket of unassimilated humans. Surprisingly, Melanie's
consciousness has not been eliminated, and it struggles for control of her body.
Melanie and Wanderer carry out an internal conversation and debate with each other
